CREATE TABLE IF NOT EXISTS "main_ingredients" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL UNIQUE, "measurement_unit" varchar(50) NOT NULL);
CREATE TABLE IF NOT EXISTS "main_tags" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(100) NOT NULL UNIQUE, "color" varchar(50) NOT NULL UNIQUE, "slug" varchar(150) NOT NULL UNIQUE);
CREATE TABLE IF NOT EXISTS "main_tobuylist" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT);
CREATE TABLE IF NOT EXISTS "main_recipe" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "name" varchar(150) NOT NULL, "img" varchar(255) NULL, "description" varchar(400) NOT NULL, "time_to_cook" integer NOT NULL, "author_id" bigint NOT NULL REFERENCES "users_user" ("id") DEFERRABLE INITIALLY DEFERRED, "tags_id" bigint NOT NULL REFERENCES "main_tags" ("id") DEFERRABLE INITIALLY DEFERRED);
