CREATE TABLE IF NOT EXISTS "django_session" ("session_key" varchar(40) NOT NULL PRIMARY KEY, "session_data" text NOT NULL, "expire_date" datetime NOT NULL);
CREATE TABLE IF NOT EXISTS "main_favorites" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "recipe_id" bigint NOT NULL REFERENCES "main_recipe" ("id") DEFERRABLE INITIALLY DEFERRED, "user_id" bigint NOT NULL REFERENCES "users_user" ("id") DEFERRABLE INITIALLY DEFERRED);
CREATE TABLE IF NOT EXISTS "main_subscriptions" ("id" integer NOT NULL PRIMARY KEY AUTOINCREMENT, "author_id" bigint NOT NULL REFERENCES "users_user" ("id") DEFERRABLE INITIALLY DEFERRED, "sub_id" bigint NOT NULL REFERENCES "users_user" ("id") DEFERRABLE INITIALLY DEFERRED, CONSTRAINT "unique_follow" UNIQUE ("author_id", "sub_id"), CONSTRAINT "its_not_allowed_to_follow_on_yourself" CHECK (NOT ("sub_id" = "author_id")));
